import React from "react";

export default function (props) {
    const setObjectDisplay = (props)=>{
        switch (props.subMenuKey) {
            case 6 :
                return "Brief";
            case 7 :
                return ""

        }
    }
    return <div>
        Work {props.subMenuKey}
    </div>
}
